// src/components/Experience.js
import React from 'react';


const Experience = () => {
  const experiences = [
    {
      title: 'AI Engineer Intern',
      company: 'Tech Innovators Inc.',
      duration: 'June 2023 - August 2023',
      description: 'Developed machine learning models for real-time data analysis and contributed to enhancing the company’s AI-driven products.',
    },
    {
      title: 'Software Developer',
      company: 'Web Solutions LLC',
      duration: 'January 2022 - May 2023',
      description: 'Built and maintained web applications using React and Node.js, improving user experience and application performance.',
    },
    // Add more experiences as needed
  ];

  return (
    <section className="experience-section">
      <h2>Experience</h2>
      {experiences.map((exp, index) => (
        <div className="experience-item" key={index}>
          <h3>{exp.title} at {exp.company}</h3>
          <span className="duration">{exp.duration}</span>
          <p>{exp.description}</p>
        </div>
      ))}
    </section>
  );
};

export default Experience;
